import React, { useState } from 'react';

export const Componente = ({props}) => {
  console.log(props.yearActual);

  return (
    <>
      <strong>{yearActual}</strong>
      <p><button>+</button></p>
      <p><button>-</button></p>
    </>
  )
}

export default Componente;
